## 相关实例 前++与后++
```c
int main()
{
	int a = 10;
	int b = a++;
	//后置++，先赋值再++，等同int b = a; a = a + 1;

	printf('%d\n', b);
	printf('%d\n', a);
	return 0;
}
int main()
{
	int a = 10;
	int b = ++a;
	//前置++，先++再复制，等同a = a+1;int b = a; 

	printf('%d\n', b);
	printf('%d\n', a);
	return 0;
```
## 相关实例 强制类型转换
```c
int main()
{
	int a = 3.14;
	//3.14是一个浮点数，编译器默认其为double类型，double类型的数赋值给int类型的变量，会丢失精度
	printf('%d\n', a);//3
	int a = (int)3.14;
	printf('%d\n', a);//3
	return 0;
}
```。
